INSERT INTO `magazine` VALUES (1,'아티스트 갤러리','당신과 함께 나누고 싶은 이야기들, 소란 (SORAN)',16,'2018-12-27 06:20:19','<p><img src=\"/Lemon/upload/90378379-4ef5-47d4-a11e-958cf6f8eed3.png&#10;\" title=\"imgUrl20181206012923762.png\"><br style=\"clear:both;\">&nbsp;</p><h1 class=\"specl_sumry_stit\" style=\"margin: 0px; padding: 0px 0px 16px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 25px; font-family: \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" 돋움,=\"\" dotum,=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(26,=\"\" 26,=\"\" 26);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"margin: 0px 11px 0px 0px; padding: 0px 14px 0px 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(237, 174, 6); background: url(\" cdnimg.melon.co.kr=\"\" resource=\"\" image=\"\" web=\"\" common=\"\" bg_tit_vline.png\")=\"\" 100%=\"\" 9px=\"\" no-repeat;\"=\"\">Special</span>소란 (SORAN) \'행복\' 뮤직비디오 촬영 현장</h1><p>추운 겨울 우리의 마음을 따뜻하게 해줄 이야기들, 소란 (SORAN)이 [Share]로 찾아왔습니다! 앨범 발매 전부터 때와 장소를 가리지 않는 스포들로 앨범에 대한 기대감을 높여주던 소란! 티저를 통해 공개된 독특한 콘셉트의 뮤직비디오로 그 기대감의 끝을 보여줬는데요, 그 촬영 현장을 멜론 가족 여러분들에게 단독 공개합니다!&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><h1 class=\"specl_sumry_stit\" style=\"margin: 0px; padding: 0px 0px 16px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 25px; font-family: \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" 돋움,=\"\" dotum,=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(26,=\"\" 26,=\"\" 26);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"margin: 0px 11px 0px 0px; padding: 0px 14px 0px 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(237, 174, 6); background: url(\" cdnimg.melon.co.kr=\"\" resource=\"\" image=\"\" web=\"\" common=\"\" bg_tit_vline.png\")=\"\" 100%=\"\" 9px=\"\" no-repeat;\"=\"\">Album</span>소란 (SORAN) [Share]</h1><p><img src=\"/Lemon/upload/b4967142-ef11-45af-a0f6-158cf810b18a.jpg&#10;\" title=\"10230062.jpg\">&nbsp;<b>우리들의 이야기와 함께, 이번엔 당신의 이야기를 들려주세요.</b></p><p>&nbsp;</p><p>서로 다른 시간과 감정들, 하지만 함께 기억하고 느끼고 싶은 이야기들. 때로는 서로 등을 돌린 채 다른 방향을 보다가도, 우리는 같은 숨을 쉬며 서로의 감정을 공유하고 공감할 수 있습니다. 그렇게 서로 나눈 이야기들과 감정들, 짧지만 따뜻한 대화들로 완성된 하나의 이야기로 우리들은 함께 행복해집니다. 당신에게 들려주고 싶은, 당신과 함께 기억하고 싶은 소란의 이야기들을 전합니다. 그리고 이번엔 당신의 이야기를 들려주세요.</p><p>&nbsp;</p><p>&nbsp;</p><h1 class=\"specl_sumry_stit\" style=\"margin: 0px; padding: 0px 0px 16px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 25px; font-family: \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" 돋움,=\"\" dotum,=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(26,=\"\" 26,=\"\" 26);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"margin: 0px 11px 0px 0px; padding: 0px 14px 0px 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(237, 174, 6); background: url(\" cdnimg.melon.co.kr=\"\" resource=\"\" image=\"\" web=\"\" common=\"\" bg_tit_vline.png\")=\"\" 100%=\"\" 9px=\"\" no-repeat;\"=\"\">Track by Track</span>소란 (SORAN) [Share]</h1><p><img src=\"/Lemon/upload/70dd033f-299d-4f0c-b41b-0e8648e7e50e.jpg&#10;\" title=\"imgUrl20181205114903799.jpg\"><br style=\"clear:both;\">&nbsp;</p><h2 class=\"specl_sumry_stit\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 12px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 22px; font-family: \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" 돋움,=\"\" dotum,=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(26,=\"\" 26,=\"\" 26);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" margin-top:=\"\" 0px=\"\" !important;\"=\"\">\'행복\'</h2><div class=\"text\" style=\"margin: 0px; padding: 0px 0px 32px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 20px; font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" overflow-wrap:=\"\" break-word;=\"\" word-break:=\"\" break-all;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">힘들고 어려운 일상을 보내다가도 사랑하는 사람을 생각하면 따뜻해지는 마음을 잔잔한 사운드 구성과 소박하면서 공감이 가는 가사로 표현했습니다.</div><h2 class=\"specl_sumry_stit\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 12px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 22px; font-family: \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" 돋움,=\"\" dotum,=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(26,=\"\" 26,=\"\" 26);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" margin-top:=\"\" 0px=\"\" !important;\"=\"\">\'123\'</h2><div class=\"text\" style=\"margin: 0px; padding: 0px 0px 32px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 20px; font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" overflow-wrap:=\"\" break-word;=\"\" word-break:=\"\" break-all;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">한 걸음 한 걸음씩, 사랑하는 연인에게 다가가는 즐거운 발걸음, 듣다 보면 나도 모르게 발끝을 까닥이는 소란만의 발랄한 연애 스토리!</div><h2 class=\"specl_sumry_stit\" style=\"margin-right: 0px; margin-bottom: 0px; ma