erif;=\"\" vertical-align:=\"\" baseline;=\"\" overflow-wrap:=\"\" break-word;=\"\" word-break:=\"\" break-all;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\" align=\"justify\">타이틀곡 \'행복’을 연주곡 버전으로 다시 한 번 새롭게 들으실 수 있습니다.</div><h2 class=\"specl_sumry_stit\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 12px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 22px; font-family: \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" 돋움,=\"\" dotum,=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(26,=\"\" 26,=\"\" 26);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" margin-top:=\"\" 0px=\"\" !important;\"=\"\">\'잠이 안 와 (CD only)\'</h2><div class=\"text\" style=\"margin: 0px; padding: 0px 0px 32px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 20px; font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" overflow-wrap:=\"\" break-word;=\"\" word-break:=\"\" break-all;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">밤의 틈 사이로 찾아와 나를 사로잡고 떠나지 않는 너의 생각. 오늘도 잠 못 이루는 당신의 밤을 트렌디한 팝 사운드로 밝혀주는 노래입니다.</div><div class=\"text\" style=\"margin: 0px; padding: 0px 0px 32px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 20px; font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" overflow-wrap:=\"\" break-word;=\"\" word-break:=\"\" break-all;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><br></div>','imgUrl20181205114903799.jpg'),(2,'금주의 신보','트렌디한 실력파 래퍼 페노메코',4,'2018-12-27 06:28:57','<h1 class=\"specl_sumry_stit\" style=\"margin: 0px; padding: 0px 0px 16px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 25px; font-family: \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" 돋움,=\"\" dotum,=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(26,=\"\" 26,=\"\" 26);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"margin: 0px 11px 0px 0px; padding: 0px 14px 0px 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(237, 174, 6); background: url(\" cdnimg.melon.co.kr=\"\" resource=\"\" image=\"\" web=\"\" common=\"\" bg_tit_vline.png\")=\"\" 100%=\"\" 9px=\"\" no-repeat;\"=\"\">한 주간 발매된 국내외 숨은 신보를 찾아서</span>12월 셋째 주</h1><p><span style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">\"첫 눈\", \"크리스마스\". 이 두 단어는 듣기만 해도 언제나 가슴 설레는데요. 캐럴만 들으며 애타게 기다렸던 크리스마스가 드디어 코앞으로 다가왔습니다. 모두에게 행복한 크리스마스가 되길 바라며 들뜬 마음으로 준비한 선물 같은 히든 트랙, 지금부터 전해드릴게요!</span>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><h1 class=\"specl_sumry_stit\" style=\"margin: 0px; padding: 0px 0px 16px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 25px; font-family: \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" 돋움,=\"\" dotum,=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(26,=\"\" 26,=\"\" 26);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"margin: 0px 11px 0px 0px; padding: 0px 14px 0px 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(237, 174, 6); background: url(\" cdnimg.melon.co.kr=\"\" resource=\"\" image=\"\" web=\"\" common=\"\" bg_tit_vline.png\")=\"\" 100%=\"\" 9px=\"\" no-repeat;\"=\"\">Weekly PICK!</span>페노메코 (PENOMECO) [Garden]</h1><h2 class=\"specl_sumry_stit\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 12px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 22px; font-family: \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" 돋움,=\"\" dotum,=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(26,=\"\" 26,=\"\" 26);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" margin-top:=\"\" 0px=\"\" !important;\"=\"\">- 단 하나뿐인 멋진 공간</h2><p><img src=\"/Lemon/upload/1c2cecd4-e3b9-4d6c-b686-2751ccbd18c9.jpg&#10;\" title=\"imgUrl20181221032659801.jpg\"><br style=\"clear:both;\">&nbsp;</p><p><span style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">첫 번째 주인공은 국내 힙합 신의 선두 자리에 서 있는 92라인 FANXY CHILD 크루의 멤버 페노메코 (PENOMECO)입니다. FANXY CHILD는 페노메코 (PENOMECO), DEAN, Crush, millic (밀릭), 신용식 (Stay Tuned) 그리고 수장 지코 (ZICO)로 구성. 멤버들의 이름만 봐도 이에 소속되어 있는 그의 실력이 얼마나 대단할지 감이 오는데요. 지코 (ZICO)의 \'말해 Yes Or No (Feat. PENOMECO, The Quiett)\'에 피처링으로 참여하며 입지를 다져 나가기 시작. 지난해 “쇼 미 더 머니 시즌 6”에 참여하면서 존재감을 확고히 알렸죠. 아쉽게도 탈락의 고배를 마셨지만 이후 싱어송라이터들의 경쟁 프로그램인 “브레이커스”에 출전해 아티스트의 진면목을 보여주며 당당히 우승을 차지하였습니다.</span><br style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><br style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">그의 음악은 시작과 동시에 독보적인 음색과 독특한 플로우로 모든 감각을 사로잡으며 집중케 하는 매력을 가졌는데요. 멜로디컬한 라인을 날카롭지만 유연하게 파고드는 래핑으로 트렌디한 음악이 무엇인지 제대로 보여줍니다.</span>&nbsp;</p><p><span style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">&nbsp;</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><img src=\"/Lemon/upload/e56c21ab-9c6a-4842-b855-1f6d919485cf.jpg&#10;\" title=\"imgUrl20181221032710815.jpg\"><br style=\"clear:both;\">&nbsp;</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">2018년 12월, 그의 다채로운 음악적 향을 가득 담아낸 미니 앨범 [Garden]을 발표하였는데요. 완성도 높은 6개의 작품은 첫 트랙부터 짙은 향을 내뿜으며 그 가치를 입증해 보입니다. 절친 Crush와 환상적인 호흡을 보여준 타이틀곡 ‘No.5 (Feat. Crush)’는 마릴린 먼로의 잠옷이라 불리는 향수 \"샤넬 NO.5\"에서 따온 것인데요. 노래 속 그녀에게서 풍기는 향이 무엇이든 내겐 NO.5라며 매료된 모습을 재치있게 표현해내며 리스너들의 감성까지 향기롭게 자극하고 있죠. 이외에도 The Quiett, 개코, ELO 등 막강한 피처링 진을 자랑, 트랙마다 각기 다른 향을 머금고 있음을 확인할 수 있는데요. 페노메코의 섬세한 손길로 큐레이팅 한 [Garden]으로 여러분을 초대합니다.</span>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><h1 class=\"specl_sumry_stit\" style=\"margin: 0px; padding: 0px 0px 16px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 25px; font-family: \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" 돋움,=\"\" dotum,=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(26,=\"\" 26,=\"\" 26);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"margin: 0px 11px 0px 0px; padding: 0px 14px 0px 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(237, 174, 6); background: url(\" cdnimg.melon.co.kr=\"\" resource=\"\" image=\"\" web=\"\" common=\"\" bg_tit_vline.png\")=\"\" 100%=\"\" 9px=\"\" no-repeat;\"=\"\">Focus #1</span>자밀킴 [Knock it Down (prod. By SHIBOI)]</h1><h2 class=\"specl_sumry_stit\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 12px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 22px; font-family: \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" 돋움,=\"\" dotum,=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(26,=\"\" 26,=\"\" 26);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" margin-top:=\"\" 0px=\"\" !important;\"=\"\">- 차원이 다른 모태 음악인</h2><div class=\"album_image\" style=\"margin: 0px; padding: 0px 0px 24px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" width:=\"\" 736px;=\"\" display:=\"\" inline-block;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><img src=\"/Lemon/upload/b759276f-7f88-4203-9851-8ff1f0900652.jpg&#10;\" title=\"imgUrl20181221032826791.jpg\"><br style=\"clear:both;\"></div><p><span style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">2015년 \"슈퍼스타 K7\"에 참가해 최대 규모의 팬덤을 이끌며 이름을 알리기 시작한 자밀킴. 그의 천재적인 음악성과 뛰어난 감각은 리스너들에게 신선한 자극제로 다가왔었죠. 음악을 전공한 부모님 아래서 자연스레 음악과 친밀하게 지낸 그는 다룰 줄 아는 악기가 무려 14가지 정도라고 하는데요. 정작 악보는 볼 줄 모른다는 아이러니한 매력의 소유자. 상업적인 음악보다는 진정으로 자신의 감성을 담아낸 음악을 하고 싶다고 밝힌 그는 실제로 Jason Mraz, Bruno Mars 등이 속한 미국의 대형 음반사 Atlantic Records의 계약 제의도 거절한 적이 있죠.</span><br style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><br style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">그의 매혹적인 음색과 중독성 강한 리듬감을 담아낸 신보 [Knock it Down (prod. By SHIBOI)]이 국내 릴리스되어 소개해 드리려 합니다. 도입부부터 스타일리시함으로 무장한 타이틀곡 \'Knock it Down\', 그루브하면서도 묵직하게 내려찍는 비트와 거친 보컬의 조화가 인상적인 \'My Cool\', 리드미컬한 사운드와 빈틈없이 꽉꽉 채운 코러스로 완성도를 높인 \'Hair Down\'등 지금까지와는 또 다른 음악 스타일을 만날 수 있는데요. 차원이 다른 진정성이 담긴 자밀킴의 음악을 절대 놓치지 마세요!</span>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><h1 class=\"specl_sumry_stit\" style=\"margin: 0px; padding: 0px 0px 16px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 25px; font-family: \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" 돋움,=\"\" dotum,=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(26,=\"\" 26,=\"\" 26);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"margin: 0px 11px 0px 0px; padding: 0px 14px 0px 0px; border: 0px; font: inherit; vertical-align: baseline; color: rgb(139, 194, 35); background: url(\" cdnimg.melon.co.kr=\"\" resource=\"\" image=\"\" web=\"\" common=\"\" bg_tit_vline.png\")=\"\" 100%=\"\" 9px=\"\" no-repeat;\"=\"\">Focus #2</span>Daniel Powter [GIANTS]</h1><h2 class=\"specl_sumry_stit\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 12px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 22px; font-family: \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" 돋움,=\"\" dotum,=\"\" \"apple=\"\" sans-serif;=\"\" vertical-align:=\"\" baseline;=\"\" letter-spacing:=\"\" -1px;=\"\" color:=\"\" rgb(26,=\"\" 26,=\"\" 26);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" margin-top:=\"\" 0px=\"\" !important;\"=\"\">- 치유를 부르는 목소리</h2><p><img src=\"/Lemon/upload/5e24cccc-bbc5-44bc-bb45-bd516908a263.jpg&#10;\" title=\"imgUrl20181221033010967.jpg\"><br style=\"clear:both;\">&nbsp;</p><p><span style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">Daniel Powter는 TV 광고 음악으로 많이 사용된 \'Bay Day\' 때문에 대중들에게 이름보다는 음악이 더 익숙한 싱어송라이터인데요. 유럽 코카콜라 광고에 처음 쓰이면서 폭발적인 인기를 얻기 시작, 당시 최고의 인기 오디션 프로그램 \"American Idol 5\"에 BGM으로 선정되면서 파이널 무대에서 직접 라이브까지 선보였죠. 이 곡은 싱글 300만 장 이상의 판매고와 2006년 빌보드 연말 차트 1위까지 차지하며 지금까지도 전 세계적으로 사랑받는 노래로 손꼽히는데요. 사실 그는 \'Bay Day\' 이후 그렇다 할 히트작을 내지 못하면서 반짝 스타라는 불명예를 떠안게 되었죠. 하지만 그보다 마음을 평온하게 해주는 목소리의 소유자가 또 있을까요.</span><br style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><br style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\"><span style=\"color: rgb(102, 102, 102); font-family: 돋움, Dotum, \" 맑은=\"\" 고딕\",=\"\" \"malgun=\"\" gothic\",=\"\" \"apple=\"\" sans-serif;=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\">그만이 가진 특유의 서정성과 잔잔히 밀려오는 강한 울림은 13년이라는 시간 동안 사랑받고 있는 \'Bay Day\'가 입증해주는데요. 그가 오랜 침묵을 깨고 6년 만에 본격적으로 활동을 재개! 다시 듣게 된 감미로운 목소리와 녹슬지 않은 실력은 너무 반갑기만 합니다. 앞서 조심스레 내비쳤던 리드 싱글 3곡과 색다른 변신을 꾀한 펑키 타이틀 ‘Delicious’ 그리고 우리의 띵곡 ‘Bad Day’까지 넣은 앨범은 그에게 제2의 전성기가 안겨주리라.</span></p><p>&nbsp;</p>','imgUrl20181221032710815.jpg');
