INSERT INTO `music` VALUES (1,'하루도 그대를 사랑하지 않은 적이 없었다','맞이하고 보내준 수 많은 일 년 중\r\n그대 내게 떠났던 그 해가 있었죠\r\n어디에 있을까 잘 지내 지나요\r\n아팠던 건 잘 보내 줬나요\r\n\r\n날 떠나겠다는 말 참 힘들었어요\r\n사랑한단 말도 그대가 했기에\r\n거기서 떠나요 나도 잘 떠났으니\r\n이제야 그댈 이해하네요\r\n\r\n사랑 누구나 하는 흔하디 흔한 이야기\r\n시작의 이유도 헤어짐의 이유도\r\n그땐 모르기에 그저 치열한 날들\r\n우린 어떤 사랑을 했었나요 그 가슴에\r\n\r\n가지 말라는 말 왜 안 했겠어요\r\n혹시 싫어할까 가슴에 남긴 말\r\n그대는 그 날로 나를 지워갔겠죠\r\n이제야 그댈 보고 싶은데\r\n\r\n사랑 누구나 하는 흔하디 흔한 이야기\r\n숨마저 못 쉬던 걸을 수조차 없던\r\n이별이 기다려 모두 가져간 날들\r\n우린 어떤 이유가 있었나요 떠나던 날\r\n\r\n익숙함을 핑계 삼아야 했던\r\n그날이 이제는 그리워질 텐데\r\n말을 못해서 표현 못해서\r\n그댈 단 하루라도 사랑하지 않은 적이 없단 걸\r\n\r\n사랑 누구나 하는 흔하디 흔한 이야기\r\n시작의 이유도 헤어짐의 이유도\r\n그땐 모르기에 그저 치열한 날들\r\n우린 어떤 사랑을 했었나요 그 가슴에\r\n\r\n사랑 누구나 하는 흔하디 흔한 이야기\r\n숨마저 못 쉬던 걸을 수 조차 없던\r\n이별이 기다려 모두 가져간 날들\r\n우린 어떤 이유가 있었나요 떠나던 날','006. 임창정 - 하루도 그대를 사랑하지 않은 적이 없었다.mp3','Ballad','243',NULL,1,3,NULL),(2,'Good Day (Feat. 팔로알토) (Prod. 코드 쿤스트)','낮엔 파란 하늘 별이 보이는 밤\r\n기분 좋은 날 오랜만에 모일까?\r\n내가 살아가는 삶을\r\n정말 사랑하지 나는\r\n기분 좋은 날 오랜만에 모일까?\r\nOoh ya ya ya ya yah\r\nOoh ya ya ya ya yah\r\nOoh ya ya ya ya yah\r\n기분 좋은 날씨야 오랜만에 모일까?\r\nI just wanna chill with my homies\r\n하얀색의 모래 또\r\n파란색의 물 위엔\r\n파도들이 쭉 밀려오지\r\n전화해서 잡아둬 펜션\r\n이미 올라온 텐션 Yea\r\nI don\'t care\r\n모아둔 돈을 깨\r\nLotta cash\r\n얼마든 I\'m okay yea\r\n비싼 옷 빼\r\n입어 Cuz\r\nIt\'s a good day\r\n많고 또 많은 스트레스는 어려워\r\n때로는 정답을 몰라\r\nSometimes I feel like I\'m at war\r\nOh no but I know it\'s gon be alright\r\nYea\r\n바다로 올라 태워 가자 Boat ride\r\n친구들 불러 몽땅\r\n바람 부는 소리\r\n들뜬 맘에 잠을 못자 Yea\r\n비싼 옷 빼\r\n입어 Cuz\r\nIt\'s a good day\r\nSeoul city 서있어 난 빌딩 옥상에서 봐\r\n어딘가에 가는 사람들 그 사이에\r\n사이에 나 줄처럼 얽힌 우리 삶\r\n거기서 도망쳐 나왔어\r\n기분은 High with 코쿤 또 팔로\r\nHola pullup hola 우야\r\n기분 좋은 날씨야 다 모일까\r\nIndigo cozyboys 우주로 비행\r\nIndigo cozyboys 우주로 비행\r\n인생은 Trip but 안해 Trip love\r\n난 필요해 들어 내 1집\r\n인생은 Trip 인생은 여행\r\n눈치 왜봐 걔네말 뻔해\r\n인생은 Trip 인생은 여행\r\n어디든지 가자 Ok\r\n내위 높지 햇빛 날씬 좋게\r\nSeoul city 먼진 걷게해\r\nSeoul city rollin seoul city finesse\r\nBulling 세우지 내 Chain bling cling so\r\n여전히 간지부리지 바람에 내 금 스치지\r\nGeekin geekin will I am\r\n가득 딴 커