는\r\n내 노래를 피해 걸어줘 (걸어줘)\r\n\r\n넌 나를 못알아 보고 \r\n10시에 민증검사하러 왔지\r\n그러더니 표정이 굳고 \r\n민증 그대로 내려놓고 갔지\r\n잘가! 내친구야!\r\n다음에는 김치 볶음밥!\r\n주문할게 한국엔 팁 문화\r\n가 없는게 참 아쉽다\r\n\r\nyo 맴메 맴메 맴메\r\n때 때 때 때 때 때려\r\ngang gang gang gang gang gang\r\n난요즘 trap해 trap해 trap해\r\n후드려 패패패패패패\r\n후드륵 칵 침 퉤퉤퉤퉤\r\n야 이런 자식들은 엉덩이를 때려야해\r\n이제 화해하자 쌤쌤쌤쌤\r\n\r\n난 너가 했던짓을 A4 에 적어놨었지\r\n너무 힘들면 교무실에 던질라고 했지\r\n그때 그 A4를 이노래에 옮길게\r\n우주비행선을 타고 비행청소년을 깨!\r\n\r\nBreaking Bad\r\nBaaaaaaaaad\r\nBreaking Bad Breaking Bad \r\nBreaking Bad Breaking Bad \r\nBaaaaaaaaad\r\nBreaking Bad Breaking Bad \r\nBreaking Bad Breaking Bad\r\n\r\n그래 많이 컸어 내가 봐도\r\n날 괴롭혔던 애들 봐도\r\n너네는 야간알바 하니까\r\n날 모니터로 보겠다\r\n이왕이면 더큰걸로 (봐!)\r\n이왕이면 고화질로 (봐!)\r\n이왕이면 내공연장 한번 놀러와\r\n너가 여기에 없는게 난 그냥\r\n좀 아쉬울뿐이야\r\n그래도 괜찮아 이 노래는 정말 (좋아!)\r\n잘될꺼고 너는 이 노래를 피해서\r\n걸어다닐 수 없어\r\n날 따라다니며 괴롭힌 널 따라다녀\r\n\r\n잘 지내나요 그댄 어딨나요\r\n그댄 너무 밑에 있어 보이질 않아요\r\n우주비행 우린 너무 높이 올라와 버렸지\r\n우주비행 선을 타고 비행선을 깨\r\n\r\nBreaking Bad\r\nBaaaaaaaaad\r\nBreaking Bad Breaking Bad \r\nBreaking Bad Breaking Bad \r\nBaaaaaaaaad\r\nBreaking Bad Breaking Bad \r\nBreaking Bad Breaking Bad\r\n\r\nBreaking Bad 나쁜것들을 깨 부셔야해\r\nBreaking Bad 나쁜것들을 깨 부셔\r\nBreaking Bad 나쁜것들을 깨 부셔야해\r\nBreaking Bad 나쁜것들을 깨 부셔','099. OLNL (오르내림) - 브레이킹배드 (Feat. 기리보이).mp3','HipHop','203',NULL,8,1,NULL),(100,'Havana (Feat. Young Thug)','','098. Camila Cabello - Havana (Feat. Young Thug).mp3','','218',NULL,82,2,NULL);
