INSERT INTO `notice` VALUES (1,'서비스 점검','스트리밍 시스템 점검 작업 안내','<p><font color=\"#666666\" face=\"돋움, Dotum, 맑은 고딕, Malgun Gothic, Apple Gothic, sans-serif\">안녕하세요. <span style=\"color: rgb(255, 170, 0);\">레몬</span>에서 알려드립니다.</font></p><p><font color=\"#666666\" face=\"돋움, Dotum, 맑은 고딕, Malgun Gothic, Apple Gothic, sans-serif\"><br></font></p><p><font color=\"#666666\" face=\"돋움, Dotum, 맑은 고딕, Malgun Gothic, Apple Gothic, sans-serif\">더욱 안정된 음악감상 환경을 제공해드리기 위해&nbsp;</font><span style=\"color: rgb(255, 170, 0); font-family: 돋움, Dotum, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Apple Gothic&quot;, sans-serif;\">레몬</span><font color=\"#666666\" face=\"돋움, Dotum, 맑은 고딕, Malgun Gothic, Apple Gothic, sans-serif\">&nbsp;시스템 점검 작업이 진행됩니다.</font></p><p><font color=\"#666666\" face=\"돋움, Dotum, 맑은 고딕, Malgun Gothic, Apple Gothic, sans-serif\">작업 시간 동안&nbsp;</font><span style=\"color: rgb(255, 170, 0); font-family: 돋움, Dotum, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Apple Gothic&quot;, sans-serif;\">레몬</span><font color=\"#666666\" face=\"돋움, Dotum, 맑은 고딕, Malgun Gothic, Apple Gothic, sans-serif\">&nbsp;스트리밍 서비스 이용이 원활하지 않을 수 있으니 양해 부탁 드립니다.</font></p><p><font color=\"#666666\" face=\"돋움, Dotum, 맑은 고딕, Malgun Gothic, Apple Gothic, sans-serif\"><br></font></p><p><font color=\"#666666\" face=\"돋움, Dotum, 맑은 고딕, Malgun Gothic, Apple Gothic, sans-serif\">▶ 작업시간 : 12월 28일(금) 새벽 06:00 ~ 06:30 (30분간)</font></p><p><font color=\"#666666\" face=\"돋움, Dotum, 맑은 고딕, Malgun Gothic, Apple Gothic, sans-serif\">▶ 작업내용 :&nbsp;</font><span style=\"color: rgb(255, 170, 0); font-family: 돋움, Dotum, &quot;맑은 고딕&quot;, &quot;Malgun Gothic&quot;, &quot;Apple Gothic&quot;, sans-serif;\">레몬</span><font color=\"#666666\" face=\"돋움, Dotum, 맑은 고딕, Malgun Gothic, Apple Gothic, sans-serif\">&nbsp;스트리밍 시스템 개선</font></p><p><font color=\"#666666\" face=\"돋움, Dotum, 맑은 고딕, Malgun Gothic, Apple Gothic, sans-serif\"><br></font></p><p><font color=\"#666666\" face=\"돋움, Dotum, 맑은 고딕, Malgun Gothic, Apple Gothic, sans-serif\">더욱 빠르고 안정적인 서비스로 보답해 드리겠습니다.</font></p><p><font color=\"#666666\" face=\"돋움, Dotum, 맑은 고딕, Malgun Gothic, Apple Gothic, sans-serif\">감사합니다.</font></p>',1,'2018-12-27'),(2,'서비스 소식','레몬이 새로워졌습니다.','<p>안녕하세요. 레몬입니다.</p><p>&nbsp;</p><p>국내외 대중음악의 트렌드는 물론 음악 장르의 심도있는 정보까지 담을 수 있도록 신규 필진들과 함께 뮤직스토리 카테고리를 개편했습니다.</p><p>&nbsp;</p><p>감사합니다.</p>',0,'2018-12-27'),(3,'안내','윈도우 플레이어 보안 강화 업데이트 안내','<p>안녕하세요. 멜론에서 알려드립니다.</p><p>&nbsp;</p><p>윈도우 플레이어가 12월 27일 금요일에 업데이트 됩니다.</p><p>&nbsp;</p><p>감사합니다.</p>',0,'2018-12-27');
